import {Route, Routes} from "react-router-dom"
import Header from "./components/Header/Header"
import Home from "./components/Home/Home";

function App() {
  return (
    <div>
   <Header/>
   <Routes>
        <Route path="/" exact element={<Home/>}/>
        <Route path="/acasa" exact element={<Home/>}/>
   </Routes>
    </div>
  );
}

export default App;
